        "text" : "  \nFull information about this event is shown on the official website @ tgvs.techgrind.asia \n  \n\nWhat is · TechGrind Ventures Syndicate (TG VS) ·? \nAn exclusive investor syndicate of Southeast Asia's most experienced Serial Entrepreneurs, Angel & Early-Stage investors. Contact us to discuss joining the syndicate. \nWhat is the mission of · TG VS ·? \nTo create a vibrant, connected, cooperative & well-educated investor community for Angel & Early-Stage investments in South East Asia. \nWhat is · Venture Investor Lab ·? \nThe premier bi-yearly workshop & bootcamp for Angel & Early-Stage venture investors in South East Asia. Sign up for the next Venture Investor Lab workshop & bootcamp. \nWhat can I expect from attending a · Venture Investor Lab ·? \n· Connect with the region's most active, successful, and experienced Entrepreneurs, Angels & Early-Stage investors. · Learn & share critical legal topics in investing; such as IP & patenting, trade laws, investor rights, global jurisdictions, ASEAN business laws, and more. · Learn & share critical financial topics in investing; such as equity & dilution, risk analysis, portfolio strategies, regional & global jurisdictions, taxation of exits & EBIDTA, and more. · Learn & share critical technical topics in investing; such as product/market fit, team valuation, problem/solution validation, company processes & data tracking, market strategies, company evaluations, due dilligence, and more. · Get access to ASEAN's best dealflow & develop dealflow best practices, partnerships, & abilities. · Gain access to a pool of Limited Partners (LPs). Create Angel Syndicates and co-investor relationships. \nLast but not least... \nTake part in a live investment deal with 2 seed-stage startups currently fundraising. \nTechGrind Incubator & Venture Capital will bring 2 startups we are currently investing in. You will get to see their investor pitch; you will be part of our due dilligence process; you will participate in our term sheet negotiations - and finally you will get a chance to join the investment round at a minimal $20k buy-in. \n\nIncluded in this event is a fine-dining 5-star buffet lunch at the Shangri-La Hotel. "
