    "name" : {
        "html" : "2016 Winter Antiques Show • January 22-31, 2016",
        "text" : "2016 Winter Antiques Show • January 22-31, 2016"
    },
    "description" : {
        "html" : "<P STYLE=\"line-height: 18px; margin: 0px; padding: 0px 0px 8px; color: #666666; letter-spacing: 0.5px; text-align: left;\"><SPAN STYLE=\"font-family: helvetica; font-size: small;\"><SPAN STYLE=\"color: #333333;\"><SPAN STYLE=\"color: #000000;\">The Winter Antiques Show marks its 62nd year as the most prestigious art, antiques, and design fair in America, featuring the “best of the best” from Antiquity through the present. Held at the historic Park Avenue Armory in New York City, the Show provides curators, new and established collectors, dealers, and design professionals with opportunities to view and purchase exceptional pieces </SPAN></SPAN></SPAN><SPAN STYLE=\"color: #000000; font-family: helvetica; font-size: small;\">showcased by 73 exhibitors.</SPAN></P>\r\n<P STYLE=\"line-height: 18px; margin: 0px; padding: 0px 0px 8px; color: #666666; letter-spacing: 0.5px; text-align: left;\"><SPAN STYLE=\"color: #000000; font-family: helvetica; font-size: small;\"><BR></SPAN></P>\r\n<BLOCKQUOTE>\r\n<H2 STYLE=\"margin: 0px; color: #404040; font-size: 20px; line-height: 1.2em; padding: 0px 0px 8px; text-align: right;\"><SPAN STYLE=\"font-family: helvetica; color: #464646;\">This fair is multiplicitous in ways that few others are anymore... </SPAN><SPAN STYLE=\"color: #464646; font-family: helvetica; line-height: 1.2em;\">with an ardent mix-it-up spirit that was once called eclectic and is now called postmodern.</SPAN></H2>\r\n<H6 STYLE=\"margin: 0px; text-align: right;\"><SPAN STYLE=\"font-size: small; font-family: helvetica; color: #464646;\">—Holland Cotter, <EM>The New York Times</EM></SPAN></H6>\r\n<P><SPAN STYLE=\"font-size: small; font-family: helvetica; color: #464646;\"><EM><BR></EM></SPAN></P>\r\n</BLOCKQUOTE>\r\n<P STYLE=\"line-height: 18px; margin: 0px; padding: 0px 0px 8px; color: #666666; letter-spacing: 0.5px; text-align: left;\"><SPAN STYLE=\"color: #333333; font-family: helvetica; font-size: small;\">Each object exhibited at the Winter Antiques Show is vetted for authenticity, date, and condition by a committee of 160 experts from the United States and Europe. The strict vetting regulations and the vettors' expertise ensure that buyers can purchase with confidence. <BR><BR>The Winter Antiques Show is an annual benefit for East Side House Settlement, a community resource in the South Bronx that celebrates its 125th anniversary in 2016. East Side House's programs focus on education and technology as gateways out of poverty and as the keys to economic opportunity. All revenues from the show's general admissions and the net proceeds from the preview parties and other events go East Side House and contribute substantially to its private philanthropic budget. No part of sales made by exhibitors is received by East Side House.</SPAN></P>\r\n<P STYLE=\"line-height: 18px; margin: 0px; padding: 0px 0px 8px; color: #666666; letter-spacing: 0.5px; text-align: left;\"><SPAN STYLE=\"color: #333333; font-family: helvetica; font-size: small;\"><BR></SPAN></P>\r\n<HR>\r\n<P STYLE=\"line-height: 18px; margin: 0px; padding: 0px 0px 8px; color: #666666; letter-spacing: 0.5px; text-align: center;\"><SPAN STYLE=\"font-weight: bold; font-family: helvetica; font-size: small;\"><BR></SPAN></P>\r\n<P STYLE=\"line-height: 18px; margin: 0px; padding: 0px 0px 8px; color: #666666; letter-spacing: 0.5px; text-align: center;\"><SPAN STYLE=\"font-weight: bold; font-family: helvetica; font-size: small;\">Restaurants</SPAN></P>\r\n<P STYLE=\"line-height: 18px; margin: 0px; padding: 0px 0px 8px; color: #666666; letter-spacing: 0.5px; text-align: center;\"><SPAN STYLE=\"font-size: small; font-family: helvetica;\"><SPAN STYLE=\"color: #333333;\">There is a cafe on the Show floor catered by Canard.</SPAN></SPAN></P>\r\n<P STYLE=\"line-height: 18px; margin: 0px; padding: 0px 0px 8px; color: #666666; letter-spacing: 0.5px; text-align: center;\"><SPAN STYLE=\"font-size: small; font-family: helvetica;\"><SPAN STYLE=\"font-weight: bold;\">Wheelchair Access</SPAN><SPAN STYLE=\"color: #333333;\"><BR>Wheelchair access is via the 66th Street entrance.</SPAN></SPAN></P>\r\n<P STYLE=\"line-height: 18px; margin: 0px; padding: 0px 0px 8px; color: #666666; letter-spacing: 0.5px; text-align: center;\"><SPAN STYLE=\"font-family: helvetica; font-size: small;\"><SPAN STYLE=\"font-weight: bold;\">Baby Strollers</SPAN></SPAN><SPAN STYLE=\"color: #333333; font-family: helvetica; font-size: small;\"><BR>Because of large crowds at the Show on the weekends, baby strollers are not permitted on weekends. This regulation protects the child's safety. </SPAN></P>\r\n<P STYLE=\"line-height: 18px; margin: 0px; padding: 0px 0px 8px; color: #666666; letter-spacing: 0.5px; text-align: center;\"><SPAN STYLE=\"font-family: helvetica; font-size: small;\"><SPAN STYLE=\"font-weight: bold;\">Checked Bags</SPAN></SPAN><SPAN STYLE=\"color: #333333; font-family: helvetica; font-size: small;\"><BR>For security reasons, the public is required to check all bags, backpacks, large purses, shopping bags, briefcases, tote bags, and any other item deemed too large by Security.</SPAN></P>",
        "text" : "The Winter Antiques Show marks its 62nd year as the most prestigious art, antiques, and design fair in America, featuring the “best of the best” from Antiquity through the present. Held at the historic Park Avenue Armory in New York City, the Show provides curators, new and established collectors, dealers, and design professionals with opportunities to view and purchase exceptional pieces showcased by 73 exhibitors. \n  \n\nThis fair is multiplicitous in ways that few others are anymore... with an ardent mix-it-up spirit that was once called eclectic and is now called postmodern. \n—Holland Cotter, The New York Times\n  \n\nEach object exhibited at the Winter Antiques Show is vetted for authenticity, date, and condition by a committee of 160 experts from the United States and Europe. The strict vetting regulations and the vettors' expertise ensure that buyers can purchase with confidence.   The Winter Antiques Show is an annual benefit for East Side House Settlement, a community resource in the South Bronx that celebrates its 125th anniversary in 2016. East Side House's programs focus on education and technology as gateways out of poverty and as the keys to economic opportunity. All revenues from the show's general admissions and the net proceeds from the preview parties and other events go East Side House and contribute substantially to its private philanthropic budget. No part of sales made by exhibitors is received by East Side House. \n  \n\n  \nRestaurants \nThere is a cafe on the Show floor catered by Canard. \nWheelchair Access Wheelchair access is via the 66th Street entrance. \nBaby Strollers Because of large crowds at the Show on the weekends, baby strollers are not permitted on weekends. This regulation protects the child's safety.  \nChecked Bags For security reasons, the public is required to check all bags, backpacks, large purses, shopping bags, briefcases, tote bags, and any other item deemed too large by Security. "
    },
